class Solution {
  int countSubarrays(List<int> nums, int k) {
    int count = 0;
    int maxNum = nums.reduce((a, b) => a > b ? a : b);
    List<int> maxIndices = [];
    for (int i = 0; i < nums.length; i++) {
      if (nums[i] == maxNum) maxIndices.add(i);
    }
    if (maxIndices.length < k) return 0;
    for (int i = 0; i < nums.length; i++) {
      for (int j = i; j < nums.length; j++) {
        int maxCount = 0;
        for (int index in maxIndices) {
          if (index >= i && index <= j) maxCount++;
          if (maxCount == k) {
            count += nums.length - j;
            break;
          }
        }
        if (maxCount < k) break;
      }
    }
    return count;
  }
}
